import React from "react";
import Tilt from "react-tilt";
import logo from "./logo.png";

const Navigation = () => {
    return (
        <nav className="flex flex-nowrap justify-between items-center ph4 ph5-l pv3">
            <div className="flex flex-nowrap items-center">
                <Tilt className="Tilt" options={{ max: 25 }}
                    style={{ height: 50, width: 50}}>
                    <div className="Tilt-inner">
                        <img src={logo} alt="mgfglc-logo"/>
                    </div>
                </Tilt>
                <span className="ml4 moon-gray f6 f4-l fw6">Magnificent Glitch</span>
            </div>
            <p className="moon-gray f6 f4-l link dim pointer">Sign Out</p>
        </nav>
    )
}

export default Navigation
